// Obtener el valor de Fecha Factura desde el JSON de entrada
const text = $('If TG not empty').first().json['Fecha Factura'];

// Depuración: Mostrar el valor de entrada
console.log("Input Fecha Factura:", text);

// Verificar si el valor existe, si no, devolver un valor por defecto
if (!text) {
  console.log("Fecha Factura es vacío o undefined");
  return [{ json: { "Fecha Factura Formateada": '' } }];
}

// Función para transformar la fecha según el formato detectado
const result = (function() {
  // Formato 1 y 2: "February 21, 2025" o "Feb 6, 2025" (mes completo o abreviado, día, año en inglés)
  if (text.match(/^[A-Za-z]+\s\d{1,2},\s\d{4}$/)) {
    console.log("Formato detectado: Mes completo o abreviado en inglés");
    const [monthStr, day, year] = text.split(/[\s,]+/);
    const monthNames = {
      'january': '01', 'february': '02', 'march': '03', 'april': '04',
      'may': '05', 'june': '06', 'july': '07', 'august': '08',
      'september': '09', 'october': '10', 'november': '11', 'december': '12',
      'jan': '01', 'feb': '02', 'mar': '03', 'apr': '04',
      'may': '05', 'jun': '06', 'jul': '07', 'aug': '08',
      'sep': '09', 'oct': '10', 'nov': '11', 'dec': '12'
    };
    const month = monthNames[monthStr.toLowerCase()];
    const formattedDay = day.padStart(2, '0'); // Asegura dos dígitos
    return `${formattedDay}/${month}/${year}`;
  }
  // Formato nuevo: "20 de febrero de 2025" (día de mes de año en español)
  else if (text.match(/^\d{1,2}\sde\s[A-Za-z]+\sde\s\d{4}$/)) {
    console.log("Formato detectado: Día de mes de año en español");
    const [day, , monthStr, , year] = text.split(/\s+/); // Separa por espacios
    const monthNamesSpanish = {
      'enero': '01', 'febrero': '02', 'marzo': '03', 'abril': '04',
      'mayo': '05', 'junio': '06', 'julio': '07', 'agosto': '08',
      'septiembre': '09', 'octubre': '10', 'noviembre': '11', 'diciembre': '12'
    };
    const month = monthNamesSpanish[monthStr.toLowerCase()];
    const formattedDay = day.padStart(2, '0'); // Asegura dos dígitos
    return `${formattedDay}/${month}/${year}`;
  }
  // Formato 3: "2025-02-20" (año-mes-día)
  else if (text.match(/^\d{4}-\d{2}-\d{2}$/)) {
    console.log("Formato detectado: yyyy-MM-dd");
    const [year, month, day] = text.split('-');
    return `${day}/${month}/${year}`;
  }
  // Formato 4 y 5: "26 Feb 2025" o "05 Feb 2025" (día, mes abreviado, año)
  else if (text.match(/^\d{1,2}\s[A-Za-z]{3}\s\d{4}$/)) {
    console.log("Formato detectado: Día MesAbrev Año");
    const [day, monthStr, year] = text.split(/\s+/); // Simplificado, sin slice
    console.log("Day:", day, "MonthStr:", monthStr, "Year:", year); // Depuración
    const monthNames = {
      'jan': '01', 'feb': '02', 'mar': '03', 'apr': '04',
      'may': '05', 'jun': '06', 'jul': '07', 'aug': '08',
      'sep': '09', 'oct': '10', 'nov': '11', 'dec': '12'
    };
    const month = monthNames[monthStr.toLowerCase()];
    console.log("Mapped Month:", month); // Depuración
    const formattedDay = day.padStart(2, '0'); // Asegura dos dígitos
    return `${formattedDay}/${month}/${year}`;
  }
  // Formato 6: "1 Febrero 2025" (día, mes completo en español, año)
  else if (text.match(/^\d{1,2}\s(enero|febrero|marzo|abril|mayo|junio|julio|agosto|septiembre|octubre|noviembre|diciembre)\s\d{4}$/i)) {
    console.log("Formato detectado: Día Mes Año en español");
    const [day, monthStr, year] = text.split(/\s+/);
    const monthNamesSpanish = {
      'enero': '01', 'febrero': '02', 'marzo': '03', 'abril': '04',
      'mayo': '05', 'junio': '06', 'julio': '07', 'agosto': '08',
      'septiembre': '09', 'octubre': '10', 'noviembre': '11', 'diciembre': '12'
    };
    const month = monthNamesSpanish[monthStr.toLowerCase()];
    const formattedDay = day.padStart(2, '0'); // Asegura dos dígitos
    return `${formattedDay}/${month}/${year}`;
  }
  // Nuevo formato: "4-dic.-2024" (día-mes abreviado-año)
  else if (text.match(/^\d{1,2}-[a-z]{3,4}\.-\d{4}$/i)) {
    console.log("Formato detectado: Día-MesAbrev.-Año");
    const [day, monthStr, year] = text.split('-');
    const monthNamesSpanish = {
      'ene': '01', 'feb': '02', 'mar': '03', 'abr': '04',
      'may': '05', 'jun': '06', 'jul': '07', 'ago': '08',
      'sep': '09', 'oct': '10', 'nov': '11', 'dic': '12'
    };
    const month = monthNamesSpanish[monthStr.toLowerCase().replace('.', '')]; // Quitamos el punto
    const formattedDay = day.padStart(2, '0'); // Asegura dos dígitos
    return `${formattedDay}/${month}/${year}`;
  }
  // Si no coincide con ningún formato, devolver el texto original
  console.log("No se detectó ningún formato válido");
  return text;
})();

// Depuración: Mostrar el resultado final
console.log("Resultado final:", result);

// Devolver el resultado como un nuevo item con el campo formateado
return [{ json: { "Fecha Factura Formateada": result } }];

